{"query":"
  query pairHourDatas($pairId: String, $first: Int) {
    pairHourDatas(first: $first, where: { pair: $pairId }, orderBy: hourStartUnix, orderDirection: desc) {
      id
      hourStartUnix
      reserve0
      reserve1
      reserveUSD
      pair {
        token0 {
          id
        }
        token1 {
          id
        }
      }
    }
  }
","variables":{"pairId":"0xcb94975df2bf9e64c0e2cfd57d659c3d189164e2","first":24},"operationName":"pairHourDatas"}
